import React from "react";
import "./UploadIcon.css";

const UploadIcon = () => {
  return (
      <div>

    <div class="wrapper">
      <div class="file-upload">
        <input type="file" />
        <i class="fa fa-arrow-up" style={{'fontSize':'40px'}}></i>
      </div>
    </div>
    <div className="file-upload"></div>
</div>
  );
};

export default UploadIcon;
